  render(contactName, contactNumber) {
    return(
      <Container>
      <Row>
        <Col>
        <h3>Name</h3>
        <p>{contactName}</p>      
        
      </Col>
    <Col>
        <h3>Number</h3>
        <p>{contactNumber}</p>      
        </Col>
      </Row>
      {/* <Fab color="primary" aria-label="add">
<AddIcon />
</Fab> */}

    </Container>

    )
  }
}
export default ContactList;
